import React from 'react';
import Navbar from '../component/Navbar'

const Dashboard = props => {
    return (
        <div className="wrapper">
           <h1 className="display-2 text-info">MasterCloud </h1>
           <h4 className="display-2 text-info"> Télécharger ou stoker tous vos fichiers sur cette cloud </h4>
           <h4 className="display-2 text-info"> Faite vos réuinion en ligne sur cette plateform </h4>
           
        </div>
    )
}

export default Dashboard;
